INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (200948589741,'High Quality 3.5mm Stereo Music Talk Handsfree Headset Headphones In-Line Mic',42428,'08031','Verenigde Staten','US','case_for_less','4.85','USD','Nieuw','img200948589741.jpg','<div align="center"><font color="#f475af" face="Arial" size="4"><br></font><font color="#f475af" face="Arial" size="4"><a href="http://stores.ebay.com/case-for-less" target="_blank"><font face="Arial" size="2"><font style="COLOR: rgb(173,0,31); FONT-WEIGHT: bold" size="4">Do you need more accessories for your phone? Please type      your phone''s model (e.g. HTC ONE) in the Store Search Bar above to    see   our wide selection of compatible products for your      phone!</font></font></a></font><font face="Arial" size="2"><br></font></div><font face="Arial" size="2"><div align="center"><br><font style="FONT-WEIGHT: bold" color="#005a89" size="4">High Quality 3.5mm Stereo Mp3 Music Video Handsfree Headset with built in Microphone<br><br></font><font style="COLOR:     rgb(173,0,31); FONT-WEIGHT:      bold">(Nine Colors Available)<br><br></font></div></font><div align="center"><font face="Arial" size="2"><img alt="http://cellapple.com/CFL_IMGs/Universal/Headset_Assorted_Color/gallery.jpg" src="http://cellapple.com/CFL_IMGs/Universal/Headset_Assorted_Color/gallery.jpg"></font><br><div align="left"><font face="Arial" size="2"><br><br>With this 3.5mm Stereo Headset you can keep the conversations going, or watch video, play some games or listen to your favorite music with ease. This 3.5mm Stereo Headset has been optimized for your phone and features an amazing lightweight and comfortable design. This 3.5mm Stereo Headset was also optimized to cancel wind and background noise, thus making certain of crystal clear sound quality while on the move. The 3.5mm Stereo Headset embedded a super easy to use one button control that will allow for simple, answering, ending or muting of calls. This universal button will also allow the pausing or playing of your music with one simple touch and also houses a microphone for phone calls or voice commands.<br><br>3.5mm Stereo Headset Features:<br></font><ul><li><font face="Arial" size="2"><font size="2">The new "closed-type vertical-ear" design, allows you to wear comfortable</font></font></li><li><font face="Arial" size="2"><font size="2">3.5mm Black Stereo Headset, Soft Gel Earbud with Microphone.</font></font></li><li><font face="Arial" size="2"><font size="2">In-ear earpieces isolates you from surrounding noises.</font></font></li><li><font face="Arial" size="2"><font size="2">Simply plug it into your phone and secure the headset comfortably in place.</font></font></li><li><font face="Arial" size="2"><font size="2">This headset Keep your hands free and on the wheel with Built-in microphone for handsfree conversations.</font></font></li><li><font face="Arial" size="2"><font size="2">Cord mounted ON/OFF button which lets you take calls and hang up easily.</font></font></li><li><font face="Arial" size="2"><font size="2">Enjoy music with superb sound quality with this stereo headset.</font></font></li><li><font face="Arial" size="2"><font size="2"><font size="2">Please note: Stereo sound and integrated call/end button only work if these features are supported by phone. For phones that do not support stereo sound (mono), you will hear the same sound out of both ear buds</font></font></font></li></ul><font face="Arial" size="2"><font size="2"><font size="2"></font></font></font></div></div><center></center>')
